  function(res){
  return res.json()
}).then(function(data){
// store Data in State Data Variable
  console.log(data, ' data')
  setData(data)
}).catch(
  function(err){
    console.log(err, ' error')
  }
)

  return (
    <div className="App">
      <header className="App-header">
        <ItemPost
          id={1}
